use std::collections::HashSet;
use core::cmp::min;
 
fn is_swapped_case(c1: char, c2: char) -> bool {
    return (c1.is_lowercase() && c1.to_uppercase().to_string() == c2.to_string())
        || (c1.is_uppercase() && c1.to_lowercase().to_string() == c2.to_string());
}

fn react(input: &String) -> usize
{
    let mut s: Vec<char> = Vec::new();
    for i in 0..input.len() {
        match s.len() {
            0 => s.push(input.chars().nth(i).unwrap()),
            n => {
                let last_char = s[n - 1];
                if is_swapped_case(last_char,input.chars().nth(i).unwrap())
                {
                    s.remove(n-1);
                }
                else
                {
                    s.push(input.chars().nth(i).unwrap());
                }
            }
        }
    }
    return s.len();
}

fn main() {
    let input = String::from("");
    
    
    let mut unique : HashSet<String> = HashSet::new();
    
    let _v2: Vec<_> = input.chars().map(|c| unique.insert(c.to_uppercase().to_string())).collect();
    println!("Part 1: {}",react(&input));
    
    
    let mut minV : usize = 0;
    for ch in unique
    {
        let f : Vec<char> = input.chars().filter(|c|  ch!=c.to_string() && ch.to_lowercase()!=c.to_string()).collect();
        if minV == 0
        {
            minV = react(&f.into_iter().collect());
        }
        else{
        minV = min(minV,  react(&f.into_iter().collect()));
            
        }
    }
    println!("Part 2: {}",minV);
}


